constructor(params: {
        module: Module
        router: Router
        project: Project
        configuration: Configuration<unknown, unknown>
    }) {
        Object.assign(this, params)
        this.class += ` mkapi-role-${this.module.semantic.role}`
        const getFile = (entity: Entity) => {
            return entity.code.filePath
        }
        const files = [
            ...new Set(
                [
                    ...this.module.attributes,
                    ...this.module.callables,
                    ...this.module.types,
                ].map(getFile),
            ),
        ].sort((a: string, b: string) => a.localeCompare(b))

        this.children = [
            new HeaderView({
                tag: 'h1',
                withClass: `doc-module-name doc-${this.module.semantic.role}-name`,
                doc: this.module,
                relativeToPath: '',
            }),
            {
                tag: 'div',
                children: [
                    new DocumentationView({
                        documentation: this.module.documentation,
                        router: this.router,
                        configuration: this.configuration,
                    }),
                ],
            },
            { tag: 'div', class: 'my-3' },
            separatorView,
            ...[...files].map((file): AnyVirtualDOM => {
                const attributes = this.module.attributes.filter(
                    (a) => getFile(a) === file,
                )
                const types = this.module.types.filter(
                    (a) => getFile(a) === file,
                )
                const callables = this.module.callables.filter(
                    (a) => getFile(a) === file,
                )
                const fileDoc = this.module.files.find((f) => {
                    return f.path === file
                })
                return {
                    tag: 'div' as const,
                    children: [
                        { tag: 'div', class: 'my-2' },
                        new HeaderView({
                            tag: 'h2',
                            withClass: 'doc-file-name fas fa-file mt-3 mb-2',
                            doc: {
                                name: file.split('/').slice(-1)[0],
                                semantic: undefined,
                                path: file.split('/').slice(-1)[0],
                            },
                            relativeToPath: module.path,
                        }),
                        fileDoc?.documentation
                            ? new DocumentationView({
                                  documentation: fileDoc.documentation,
                                  router: this.router,
                                  configuration: this.configuration,
                              })
                            : undefined,
                        {
                            tag: 'div',
                            children: attributes
                                .map((attribute) => [
                                    new AttributeView({
                                        fromModule: this.module,
                                        attribute,
                                        router: this.router,
                                        configuration: this.configuration,
                                        project: this.project,
                                    }),
                                    ySeparatorView5,
                                ])
                                .flat(),
                        },
                        {
                            tag: 'div',
                            children: callables
                                .map((callable) => [
                                    new CallableView({
                                        callable,
                                        router: this.router,
                                        configuration: this.configuration,
                                        project: this.project,
                                        fromModule: this.module,
                                    }),
                                    ySeparatorView5,
                                ])
                                .flat(),
                        },
                        {
                            tag: 'div',
                            children: types
                                .map((type) => [
                                    new TypeView({
                                        fromModule: this.module,
                                        type,
                                        router: this.router,
                                        configuration: this.configuration,
                                        project: this.project,
                                    }),
                                    ySeparatorView5,
                                ])
                                .flat(),
                        },
                    ],
                }
            }),
        ]
    }

