export interface Configuration<
    TLayout = DefaultLayout.NavLayout,
    THeader = DefaultLayout.NavHeader,
> {
    /**
     * Defines the stylesheet to install.
     *
     * @param project
     * @returns Stylesheet full URL.
     */
    css: (project: Project) => string
    /**
     * External types to link in the documentation, where keys are symbol path and values associated URL.
     */
    externalTypes: Record<string, string>
    /**
     * Define the code url from repo for a file in the project (located at `path`) and a starting line (`startLine`).
     */
    codeUrl: ({
        project,
        path,
        startLine,
    }: {
        project: Project
        path: string
        startLine: number
    }) => string

    /**
     * If `true` or an object, use the {@link Notebook} module to parse the code documentation included in the API
     * files, eventually forwarding the parameters provided to the {@link NotebookPage} constructor.
     */
    notebook?:
        | boolean
        | {
              initialScope?: Partial<Scope>
              displayFactory?: DisplayFactory
              options?: NotebookOptions
          }

    navNode: ({
        name,
        header,
        layout,
    }: {
        name: string
        header: DefaultLayout.NavHeader
        layout: DefaultLayout.NavLayout
    }) => NavNodeData<TLayout, THeader>
}

export interface Documentation {
    /**
     * List of the sections.
     */
    sections: DocumentationSection[]
}

export interface DocumentationSection {
    /**
     * Section's title.
     */
    title?: string
    /**
     * Associated semantic.
     */
    semantic: Semantic
    /**
     * Section's content.
     */
    content: string
    /**
     * Content's type.
     */
    contentType: string
}

export interface Entity {
    /**
     * Name.
     */
    name: string
    /**
     * Documentation.
     */
    documentation: Documentation
    /**
     * Code information.
     */
    code: Code
    /**
     * Semantic associated.
     */
    semantic: Semantic
    /**
     * The path (e.g. `ModuleFoo.TypeBar.attrBaz`)
     */
    path: EntityPath
}

export interface File {
    /**
     * Name.
     */
    name: string
    /**
     * Path.
     */
    path: string
    /**
     * Documentation.
     */
    documentation: Documentation
}

export interface Project {
    /**
     * Its name.
     */
    name: string
    /**
     * The base path of the corresponding node in the documentation.
     */
    docBasePath: string
}

export interface Semantic {
    /**
     * Role, a unique meaning (*e.g.* `Class`, `Interface`, `TypeAlias`, *etc.*).
     */
    role: string
    /**
     * Some labels.
     */
    labels: string[]
    /**
     * Some attributes.
     */
    attributes: Record<string, string>
    /**
     * Some relation with other entities (grouped by a category keyword, *e.g.* `InheritedBy`).
     */
    relations: Record<string, EntityPath[]>
}

export interface Type extends Entity {
    /**
     * List of owned callable.
     */
    callables: Callable[]
    /**
     * List of owned attributes.
     */
    attributes: Attribute[]
}

